					"text": "我国医疗器械医药包装机械的高端水平与国外差距并不很大，部分设备已与当前的世界最新技术进展实现了同步，但总体水平还是与国外先进水平存在着不小的差距。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;当前，我国的医药包装机械已填补了基本品类和基本技术的空白，但在产品研发的资金来源、试验条件、产品的稳定性、自动控制等方面与国际领先水平还存在差距。在自控技术方面，国外的医药包装机械设备已经基本实现了智能化、人性化的设计，而我国医药包装机械在PLC控制、界面控制相对落后。而除了运用PLC控制技术外，必须同时在材料、设计以及所有相关的各个环节上作出配套选择，才可能实现智能化的控制。同时，我国医药包装机械在稳定性还比较欠缺，这可能会导致产品质量方面的问题，并影响到整条包装线。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;医药包装机械出众的稳定性，对于产能大、产品种类多的医药生产企业而言，是非常关键的要求，因为不稳定的设备容易导致停产断线并影响产量。影响医药包装机械稳定性的因素主要有材料、元器件和基础传动装置。首先，材料与元器件的低级配置会严重影响设备的稳定性，但是当前我国有些企业出于成本考虑而采购低级甚至劣质的材料和元器件。第二，包装机上的基础传动装置也是影响包装机械稳定性的因素之一。当前，我国的医药包装设备基本以链条、拖轮、摆秆等基础传动装置为主，这便会给机械的稳定性带来隐患，而国外的医药包装机械基本上都采用了伺服驱动系统。应该说，企业选择一个伺服电机并不是一件很困难的事情，但是企业通常会考虑到引入伺服电机的潜在成本压力。企业从传统的传动方式转而应用伺服电机，进而需要给其它机构或者设备上也配套伺服电机，这样，伴随着控制精度的提高，成本也随之增加，令很多医药生产企业没有能力承受。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;以分装机为例，国内最早的分装机的生产能力为每分钟40瓶，随后为每分钟60瓶，直至发展到每分钟120瓶。国外的同类设备在我们实现60瓶/分钟的生产速度时，就达到了300瓶/分钟。我国进行分装机自主研发的哈飞集团的产品，每分钟的产量和设备的功能等与国外设备没有差异，但稳定性不够出众。如果国外同类分装机设备可以就300瓶/分钟的生产速度实现稳定生产的话，那么国内的同类设备是生产速度一般只能够稳定于280瓶/分钟。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;再以铝塑包装机为例，我国国产的铝塑包装机与国外相比差距较大，体现每个具体的工作环节。比如，我国生产的铝塑包装机的网纹纹路深，且不均匀。又譬如，上料工序在国内外的各类型包装机上都是一个非常关键且较为薄弱的环节，但是与国外相比，我国医药包装机的上料工艺显得更为薄弱。我国还有滚刷式铝塑包装机这种采用特殊上料工艺的专用机械。就上料工序的生产能力来看，以胶囊为例，国内设备的每分钟的产量为600粒，片剂为每分钟700粒~800粒，而国外铝塑包装机的上料工序可以实现2000粒/分钟的生产速度。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;所用材料、加工手段以及机构的配套协调等因素，直接影响了铝塑包装机的生产速度及运行状况。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;当前全球医药包装机械正朝着更加符合GMP认证的方向发展。对于医药包装机械而言，深度发展的方向就是速度更快、更加稳定、自动化控制水平更高、操作更加人性化、更加方便、更加便于清洗等等。如何沿着GMP认证的深度方向去发展以及这中间的发展策略，需要中国医药包装机械行业进行深入的思考。",
