					"title_name": "医药企业对医药软包装的需求",
					"text": "复合膜是指由各种塑料与纸、金属或其他材料通过层合挤出贴面、共挤塑等工艺技术将基材结合在一起而形成的多层结构的膜。具有防尘、防污染、阻隔气体、保持香味、防紫外线、装潢、印刷、蒸煮杀菌、防静电等功能，适用于机械加工或其他各种封合方式，基本上可以满足药品包装所需的各种要求，任何一种单一的材料都无法达到这些功能。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;新型的复合膜，主要是在复合膜生产中，采用了新材料、新工艺、新设备、新工艺、新方法等，满足了一些医药用户的特定需求。目前主要有：<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;防伪包装<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;我国绝大部分药品软包装在外观设计上非常简单，包装防伪技术比较落后，这为造假者提供了可乘之机。一些医药相关企业每年投入上百万元资金采用三维激光防伪、数码防伪和压膜防伪等技术，增强了防伪效果。可应用于医药防伪的技术有七大类，包括数码防伪、油墨防伪、光学防伪、纸张防伪、特种印刷防伪、核径迹防伪、生物防伪等。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;水性油墨和胶粘剂的应用<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;目前应用成熟的油墨和胶粘剂都是溶剂型的。其优点是不言而喻的，如粘合力高，应用成熟等。缺点是对环境和工人健康有一定的危害。如果溶剂残留量超标的话，会有难闻的气味，可能对所包装的药品和服药者构成威胁。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;而水性油墨的印刷方式与溶剂型油墨一样，水墨的单价比溶剂油墨低10%—20％，印刷速度达到溶剂油墨的速度，稀释剂采用自来水或乙醇与水按一定比例混合便可，印刷过程中对人体无害，不燃，无毒，无味，符合环保要求。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;水性胶粘剂情况与之类似。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;铝塑复合软管<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;软管最早是使用铅或锡制成的。直到20世纪40年代，才出现了铝管，并因其良好的阻隔性而迅速普及。50年代出现了塑料管，60年代出现铝塑复合软管，70年代铝塑复合软管应用于牙膏包装，80年代开始应用于药膏包装。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;所谓铝塑复合软管，就是将具有高阻隔性的铝箔和具有柔韧性和耐药性的塑料经共挤复合成为片材，尔后经制管机加工而成。其特点是抗挠曲、抗龟裂、阻隔性强、无溶剂残留的影响、印刷精美。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;药品包装用铝塑复合软管是我国《医药包装行业“十五”发展规划纲要》里重点支持的产品，国内许多企业正在加紧研究其应用。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;氟卤代烃薄膜<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;氟卤代烃薄膜是氯三氟乙烯（CTFE）的共聚物，不可燃、阻隔性优良。该薄膜具有独特的应用范围，如CTFE和乙烯三氟氯乙烯共聚物。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;CTFE能够经受金属、陶瓷和其他塑料所不能经受的剧烈化学物的侵蚀。另外，CTFE薄膜的水蒸气透过率比任何塑料薄膜都低，实际上其吸湿性等于零。而且与各种基材复合，如聚乙烯、聚氯乙烯、聚酯、尼龙、铝箔等，主要用于包装需要高度防潮的药片、胶囊。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;抗菌包装<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;尽管药品生产的洁净环境是按照GMP要求设计的，但任何一个剂型生产和包装过程中都不可能绝对无菌。所以，为延长药品保质期、保证用药安全性，按GMP要求采用抗菌高分子包装材料进行药品包装，以抑制细菌污染，这也将成为药品软包装的方向之一。<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;纳米包装<br /><br />&nbsp;&nbsp;&nbsp;&nbsp;纳米技术与纳米材料在医药领域的应用和开发，为中国药品包装提供了一个千载难逢的大好时机。纳米聚合物、纳米复合材料（PNMC）、纳米黏合剂及纳米抗菌包装的发展将为药品软包装开辟新的领域。",
